import React from 'react';
import logo from '../../assets/logo.svg';

export const Header = () => {
  return (
    <header className="flex ">
      <span class="text-yellow-500"> STAR WARS</span>
      <svg alt="star wars logo" src="{swlogo}" width="200px" height="100px" />
      <img src="{logo}" />
    </header>
  );
};
